import React, { useState } from 'react';
import api from '../api';

export default function AddSale({ onCreated }){
  const [cliente_nome,setCliente] = useState('');
  const [cliente_documento,setDoc] = useState('');
  const [valor,setValor] = useState('');
  const [banco,setBanco] = useState('');
  const [status,setStatus] = useState('enviada');
  const [loja_parceira,setLoja] = useState('');
  const [observacoes,setObs] = useState('');
  const [msg,setMsg] = useState('');

  async function submit(e){
    e.preventDefault();
    setMsg('');
    const payload = { cliente_nome, cliente_documento, valor: parseFloat(valor||0), banco, status, loja_parceira, observacoes };
    try{
      const { data } = await api.post('/sales', payload);
      setMsg(`Venda #${data.id} salva. Comissão: R$ ${data.comissao?.toFixed?.(2) ?? '—'}`);
      setCliente(''); setDoc(''); setValor(''); setBanco(''); setStatus('enviada'); setLoja(''); setObs('');
      onCreated?.();
    }catch(err){
      setMsg(err?.response?.data?.msg || 'Erro ao salvar');
    }
  }

  return (
    <form onSubmit={submit}>
      <h5 className="mb-3 d-flex align-items-center gap-2">
        <i className="bi bi-plus-circle"></i>
        Cadastrar venda
      </h5>
      <div className="row g-3">
        <div className="col-md-6">
          <label className="form-label">Cliente</label>
          <input className="form-control" value={cliente_nome} onChange={e=>setCliente(e.target.value)} required/>
        </div>
        <div className="col-md-6">
          <label className="form-label">CPF/CNPJ</label>
          <input className="form-control" value={cliente_documento} onChange={e=>setDoc(e.target.value)} required/>
        </div>
        <div className="col-md-4">
          <label className="form-label">Valor</label>
          <input className="form-control" value={valor} onChange={e=>setValor(e.target.value)} required/>
        </div>
        <div className="col-md-4">
          <label className="form-label">Banco</label>
          <input className="form-control" value={banco} onChange={e=>setBanco(e.target.value)} required/>
        </div>
        <div className="col-md-4">
          <label className="form-label">Status</label>
          <select className="form-select" value={status} onChange={e=>setStatus(e.target.value)}>
            <option value="enviada">Enviada</option>
            <option value="aceita">Aceita</option>
            <option value="recusada">Recusada</option>
          </select>
        </div>
        <div className="col-md-6">
          <label className="form-label">Loja parceira</label>
          <input className="form-control" value={loja_parceira} onChange={e=>setLoja(e.target.value)}/>
        </div>
        <div className="col-md-6">
          <label className="form-label">Observações</label>
          <input className="form-control" value={observacoes} onChange={e=>setObs(e.target.value)}/>
        </div>
      </div>
      <div className="d-flex gap-2 mt-3">
        <button className="btn btn-primary">
          <i className="bi bi-save me-1"></i>Salvar
        </button>
        <button type="reset" className="btn btn-outline-secondary" onClick={()=>{setCliente('');setDoc('');setValor('');setBanco('');setStatus('enviada');setLoja('');setObs('');}}>
          <i className="bi bi-eraser me-1"></i>Limpar
        </button>
      </div>
      {msg && <div className="alert alert-info mt-3 mb-0 py-2">{msg}</div>}
    </form>
  );
}
